import React from "react";
import { useNavigate } from "react-router-dom"

export default function Register() {
  const navigate = useNavigate();

  return (
    <div>
      <h1>Sou a Register</h1>
      <button onClick={navigate('/login')}>Registrar-se</button>
    </div>
  );
}
